    fetch('api1/',lookup)
    .then(function(response){
      return response.json();
    }).then(function(res){
      console.log(y);
      y.setState({posts:res});
    }).catch(function(error){
      console.log('error',error);
    })
  }
componentDidMount()
  {
      this.setState({
        posts:[]
      });
      this.getdata();
  }


  render()
  {
    return (
      <div>
        Hello World
        {this.state.posts.map(post => <PostInline key = {post.id} post = {post}/>)}
      </div>
    );
  }
}


export default App;
